import { Expenses } from "../Types";
import { useState } from "react";

const Calculator = () => {
  const [expenses, setExpenses] = useState<Expenses[]>([]);

  let sum: string = "";
  for (let i = 0; i < expenses.length; i++) {
    sum += expenses[i].money;
  }

  return <span>000</span>;
};

export default Calculator;
